"""
Given an array A of integers, return the number of (contiguous, non-empty) subarrays that have a sum divisible by K.

 

Example 1:

Input: A = [4,5,0,-2,-3,1], K = 5
Output: 7
Explanation: There are 7 subarrays with a sum divisible by K = 5:
[4, 5, 0, -2, -3, 1], [5], [5, 0], [5, 0, -2, -3], [0], [0, -2, -3], [-2, -3]
 

Note:

1 <= A.length <= 30000
-10000 <= A[i] <= 10000
2 <= K <= 10000
"""

class Solution_1:
    def subarraysDivByK(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        Thoughts : too slow, can not pass the last test
        """
        adding_A = [num for num in A]
        res = sum([1 for num in A if num%K == 0])
        # print(res)
        len_A = len(A)
        subarry_len = 1
        while subarry_len < len_A:
            tmp = []
            for i,num in enumerate(adding_A[:-1]):
                num += A[i+subarry_len]
                tmp.append(num)
                if num % K == 0:
                    res += 1
            # print(tmp)
            adding_A = tmp
            subarry_len += 1

        return res

class Solution:
    def subarraysDivByK(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        Thoughts : calculate the sum of subarrayes from the beginning, if two sums got the same remainder mod K. then the subarray between the two are divisible by K. use a dict to store the number n of each remainder, when encounter a same remainder, it will form the n new subarrayes which are divisible by K.
        """
        remainder_map = {0:1}
        total = 0
        res = 0
        for num in A:
            total += num
            remainder = total % K
            if remainder in remainder_map:
                res += remainder_map[remainder]
            remainder_map[remainder] = remainder_map.get(remainder,0) + 1
            
        return res


